import React from 'react';
import Header from '../components/Header';

const LoginPage = () => {
  return (
    <div>
      <Header />
      <div style={{ padding: '4rem 2rem', textAlign: 'center', minHeight: '60vh' }}>
        <h1>Login Page</h1>
        <p>This is the login page content.</p>
      </div>
    </div>
  );
};

export default LoginPage;
